      </div>
      <div className="PortFolioContentCard">
        <div>
          <WildPostCard />
          <AroundTheWorldCard />
        </div>
        <div>
          <BornInSpaceCard />
          <QRV />
        </div>
      </div>
    </div>
  );
};

export default Portfolio;
